INSERT INTO `first_aid_topics` (`id`, `topic`, `instructions`) VALUES
(1, 'Choking', '1. Encourage the person to cough.\r\n2. Give up to 5 back blows and 5 abdominal thrusts if needed.'),
(2, 'রক্তপাত\r\n', '1. ক্ষত উপর সরাসরি চাপ প্রয়োগ করুন.\r\n2. আহত অঙ্গটিকে হৃদয়ের উপরে উন্নীত করুন।'),
(3, 'Burns', 'Cool the burn with running water for at least 10 minutes. Cover with a sterile dressing.'),
(4, 'Fractures', 'Immobilize the injured area. Apply ice if swelling is present.'),
(5, 'Heart Attack', 'Call emergency services immediately. Administer aspirin if available.'),
(7, 'খিঁচুনী', 'ব্যক্তিকে আঘাত থেকে রক্ষা করুন। সম্ভব হলে তাদের পাশে রাখুন।'),
(8, 'Heat Exhaustion', 'Move the person to a cool place. Give sips of water if conscious.'),
(9, 'Hypothermia', 'Gradually warm the person with blankets and warm fluids.'),
(10, 'Poisoning', 'Call emergency services immediately. Try to identify the poison if safe to do so.'),
(12, 'শ্বাস-প্রশ্বাস বন্ধ', '1. শ্বাস-প্রশ্বাসের পথ পরিষ্কার করুন। 2. মুখের মধ্যে কোন বাধা থাকলে তা সরিয়ে ফেলুন। 3. শ্বাস-প্রশ্বাস চালু করতে কার্ডিওপালমোনারি রিসাসিটেশন (CPR) শুরু করুন।'),
(13, 'হাড় ভাঙলে', '1. আক্রান্ত স্থান স্থির রাখুন এবং অপ্রয়োজনীয় নড়াচড়া এড়িয়ে চলুন। 2.  শক্ত কোন বস্তু দিয়ে আঘাতপ্রাপ্ত স্থানটি বাঁধুন (splint)।'),
(14, 'পোড়ালে', '1. পোড়া স্থানটি ঠাণ্ডা পানি দিয়ে ধুয়ে নিন। 2. পুড়ে যাওয়া স্থানে ফোসকা থাকলে তা ফাটাবেন না। 3. পরিষ্কার কাপড় দিয়ে ঢেকে রাখুন।'),
(15, 'অজ্ঞান হলে', '1. আক্রান্ত ব্যক্তিকে সোজা করে শুইয়ে দিন। 2. শ্বাস-প্রশ্বাসের জন্য মাথা একপাশে কাত করুন। 3. গায়ের শক্ত পোশাক শিথিল করুন।'),
(16, 'কাটা-ছেঁড়া এবং ক্ষত', '১. ক্ষত পরিষ্কার করা:  --  ক্ষত থেকে রক্তপাত বন্ধ করতে পরিষ্কার কাপড় বা গজ দিয়ে চাপ প্রয়োগ করুন। --  পরিষ্কার পানির নিচে ক্ষতটি ধুয়ে ফেলুন। ২. জীবাণুনাশক ব্যবহার:  --  ক্ষত পরিষ্কার করার পর জীবাণুনাশক লাগান। --  ক্ষতটি পরিষ্কার এবং শুকনো রাখুন। ৩. ব্যান্ডেজ প্রয়োগ:  --  প্রয়োজনে জীবাণুমুক্ত ব্যান্ডেজ দিয়ে ক্ষতটি ঢেকে দিন।'),
(17, 'Black eye', 'To take care of a black eye:  1. Apply a cold compress soon after the injury. Using gentle pressure, place a cold pack, a cloth filled with ice or even a bag of frozen vegetables to the area around your eye. Take care not to press on the eye itself. Apply cold as soon as possible after the injury to reduce swelling. Repeat several times a day for a day or two.  2. Apply warm or hot compresses. This may be helpful after a few days when the swelling has gone down. Repeat several times a day for a day or two.'),
(18, 'মৌমাছি কামড়ালে ', '১। প্রথমতো মৌমাছি কামড় দিয়ে থাকে যেন ভাল করে তার হুলটা ফুটাতে পারে। মৌমাছি কামড়ের পর পরই হুল ছেড়ে যায়। এটি যতক্ষণ সময় ভেতরে থাকবে বিষের যন্ত্রণা তত তীব্র হবে। তাই যত তাড়াতাড়ি সম্ভব হুল বের করে নিয়ে আক্রান্ত স্থান সাবান দিয়ে ধুয়ে ফেলতে হবে।  ২। তারপর সেই স্থানে ২০ মিনিট পর্যন্ত কাপড়ে পেঁচিয়ে বরফ লাগিয়ে রাখতে হবে। বরফ ব্যাথাকে শীতল করে এবং ফোলা ভাব কমাতে বেশ উপকারী।    ৩। বাসায় যদি লেভান্ডার অয়েল থাকে, তবে কয়েক ফোঁটা ক্ষতিগ্রস্থ স্থানে মালিশ করে দিতে হবে। এটি হুলের বিষ ধ্বংস করবে দ্রুত।  ৪। এক/দুটি রসুনের খন্ড থেঁতলে চেপে চেপে আহত স্থানে রস দিতে হবে। এরপর ভেজা তোয়ালে দিয়ে ২০-৩০ মিনিট ঢেকে রাখতে হবে। গ্রামাঞ্চালে পিয়াজ ও রসুনের ব্যবহার বেশী দেখা যায় এবং কাজও হয় দ্রুত।  ৫। মৌমাছির কামড়ের বিষাক্ততা রোধে মধু খুব গুরত্বপূর্ণ উপাদান। আক্রান্ত স্থানে অল্প পরিমাণ মধু লেপে দিয়ে তুলা,ন্যাকড়া,পাতলা কাপড় পেঁচিয়ে ঢেকে রাখতে হবে ৩০মি-১ঘন্টা। তবে যাদের মধুর এলার্জি আছে তারা এটি করতে পারবে না। সেদিকে লক্ষ্য রাখতে হবে।  যে গুরত্বপূর্ণ বিষয়টি অবশ্যই মনে রাখতে হবে তা হলো -যদি এলার্জিক কাউকে কামড় দিয়ে থাকে তবে কিছু লক্ষণ যেমনঃশ্বাস কষ্ট,জ্ঞান হারানো ইত্যাদি দেখার সাথে সাথে ঘরোয়া চিকিৎসার উপর নির্ভর না করে,ডাক্তারের কাছে নিয়ে যেতে হবে। নতুবা পরিণতি খারাপের দিকে যেতে পারে। তাছাড়া চুলকানি,ব্যথা, ফুলে যাওয়া এসব স্বাভাবিক লক্ষণ।  মৌমাছি বা বোলতায় কামড়ালে যা করবেন-  যদি মৌমাছি বা বোলতা শরীরে কামড়ে বসে থাকে তাহলে তাকে তুলে ফেলুন। এগুলো সাধারণত ত্বকের সঙ্গে একই সমতলে আঁকড়ে বসে থাকে। এগুলোকে সরানোর জন্য প্রথমে আঙুলের মাথা দিয়ে আস্তে আস্তে এর ওপরে এবং পাশে আঙুল বুলিয়ে যান, পরে হঠাৎ করে ঠেলে ফেলুন। মৌমাছি বা বোলতাকে কখনো খামচে বা চিমটি দিয়ে তুলবার চেষ্টা করবেন না। কারণ, খামচানো বা চিমটি দেওয়ার কারণে বিষের থলি থেকে সব বিষ বেরিয়ে পড়ে এবং তা হুল দিয়ে আপনার শরীরে ঢুকে যেতে পারে। কিন্তু মৌমাছি বা বোলতাকে ঠেলে সরিয়ে দিলে এ ধরনের আশঙ্কা থাকে না। হুল ফোটানো জায়গাটা বেশ লাল গরম হয়ে ফুলে যায় এবং সেখানে যন্ত্রণা হয়। তাই প্রথমেই জায়গাটিতে বরফের টুকরো চেপে ধরুন। বেশ কিছুক্ষণ এভাবে ঠান্ডা স্যাঁক দিন। এবার স্থানটিতে অ্যান্টিবায়োটিক ক্রিম লাগান। ক্রিম লাগানোর পাশাপাশি অ্যান্টিহিস্টামিন ওষুধও খেতে হবে। ব্যথার জন্য প্যারাসিটামল ওষুধ খেলেই চলবে। হুল ফোটানোর কারণে অনেকের মাথাব্যথা, বমি, শ্বাসকষ্ট, হুল ফোটার জায়ড়া ছাড়াও সমস্ত শরীরে চুলকানো, চাকা ওঠা, শরীর ফুলে যাওয়া, পেটে তীব্র ব্যথা প্রভৃতি উপসর্গ দেখা দিতে পারে। এ সব ক্ষেত্রে রোগীকে দ্রুত চিকিৎসকের কাছে বা হাসপাতালে নিয়ে যেতে হবে। লেখক : সহযোগী অধ্যাপক, হলিফ্যামিলি রেড ক্রিসেন্ট মেডিকেল কলেজ  পোকামাকড় আমাদের পরিবেশের একটি অবিচ্ছেদ্য অঙ্গ। এর মধ্যে কিছু উপকারী আবার কিছু ক্ষতিকরও বটে। মাঝে মাঝে বিভিন্ন পরিস্থিতিতে এইসব পোকামাকড়ের সংস্পর্শে এলে হুল ফুটানো কিংবা কামড় দেয়ার মত ঘটনা ঘটে থাকে।   কামড় অনুভব করার সাথে সাথে আপনি যা করতে পারেন –  ১. কামড় অনুভব করার সাথেই সাথেই উক্ত পোকা/মৌমাছি/মাকড়সাটিকে সরিয়ে দিন। কারণ যতক্ষণ পর্যন্ত এটি আপনাকে কামড়াবে ততক্ষণই বিষ শরীরে প্রবেশ করতে থাকবে।  ২. নিজেকে শান্ত রাখার চেষ্টা করুন। খুব বেশি নড়াচড়া করবেন না। কারণ নড়াচড়া বেশি করলে বিষ রক্তের মধ্য দিয়ে দ্রুত ছড়িয়ে যাবে।    ৩. যদি মৌমাছি আপনাকে হুল ফোটায়, তাহলে মৌমাছি সরিয়ে দেয়ার পরও হুল ভেঙ্গে চামড়ায় রয়ে যেতে পারে। এক্ষেত্রে যত দ্রুত সম্ভব ভাঙ্গা হুলটি চামড়া থেকে সরিয়ে ফেলুন।  ৪. যদি আপনি পায়ে অথবা হাতে কামড় খেয়ে থাকেন তাহলে বাহু যত সম্ভব নিচু করে রাখুন। এতে বিষ সহজে ছড়াবে না। কয়েক ঘণ্টা পর যদি হাত ফুলতে শুরু করে, তাহলে হাত উচু করে ফোলা কমাতে পারেন।  ৫. তবে কামড় যদি কাঁকড়া বিছের হয়ে থাকে তাহলে যত দ্রুত সম্ভব নিকটস্থ হসপিটালে যান। এখন মোটামুটি সব হাসপাতালেই কাঁকড়া বিছের বিষের এন্টি ডোট পাওয়া যায়। তাই যত দ্রুত যাবেন ক্ষতি ততই কম হবে।   ব্যথা নিরসনের জন্য করণীয় –  ১. যাই কামড়াক, সাধারণত সেগুলো যদি বিষাক্ত হয় তাহলে কামড়ের স্থানে প্রচন্ড ব্যথা হতে পারে। এই ক্ষেত্রে ক্ষতস্থানে বরফ ব্যবহার করুন। প্রথম ৬ ঘণ্টার প্রতি ঘণ্টায় ১৫/২০ মিনিট করে বরফ ব্যবহার করুন। যেসময় বরফ লাগাচ্ছেন না, সেইসময় একটি পরিষ্কার ভেজা কাপড় দিয়ে ক্ষতস্থান চেপে ধরে রাখুন এবং বরফ ব্যবহারের সময় বরফ এবং ক্ষতস্থানের মাঝে একটি পাতলা কাপড় ব্যবহার করা ভালো।  ২. ক্ষতস্থানের ফোলা কমানোর জন্য যতটুকু সম্ভব ক্ষতস্থান সমতল থেকে উচুতে রাখার চেষ্টা করুন, এতে বিষ ছড়া্বে না, ফোলাও কম হবে।  ৩. প্রাথমিক চিকিৎসা হিসেবে ক্ষতস্থানের চুলকানি, ফুলে যাওয়া, ব্যথা কমানোর জন্য Benadryl কিংবা ChlorTrimeton ধরনের এন্টিহিস্টামিন ওষুধ খেতে পারেন। তবে শিশুদের ক্ষেত্রে ডাক্তারের পরামর্শ ছাড়া কোন ওষুধ ব্যবহার না করাই শ্রেয়।  8. ব্যথা কমানোর জন্য ফার্মেসি থেকে Benzocaine জাতীয় স্প্রে ব্যবহার করতে পারেন। তবে এলার্জিক রিএকশন এর ব্যাপারে লক্ষ্য রাখবেন।  ৫. Hydrocortisone 1% cream অথবা ক্যালামাইন লোশন ক্ষতস্থানে লাগালে লালচে ভাব এবং ফোলা দূর হবে। তবে শিশুদের ক্ষেত্রে এধরনের কিছু ব্যবহার করবেন না।  ৬. ৬ ঘণ্টা বরফ ব্যবহারে যদি ফোলা কমে যায়, তাহলে আস্তে আস্তে ক্ষতস্থানে গরম কাপড়ের সেঁক দিতে পারেন। এতে ক্ষতস্থানের জীবাণু সংক্রমণ বন্ধ হবে। দাহ ও ঝলসানো ক্ষত (Burns and Scalds)'),
(19, 'কোথাও পুরে গেলে', 'শুস্ক তাপে, বিদ্যুৎ প্রবাহ, ঘর্ষনে রাসায়নিক পদার্থে বা বিকিরণে পুড়ে যাওয়াকে দাহ বলে। আদ্র তাপে যেমন-ফুটন্ত পানি। বা অন্য কোন গরম পদার্থের সংস্পর্শে এসে পুড়ে যাওয়াকে ঝলসানো বলে। পুড়ে গেলে-  বাসা বাড়িতে বিভিন্ন কারনে আগুন দিয়ে দূর্ঘটনা ঘটতে পারে। সাধারনত গরম পানি, গরম জিনিস-পত্র (পাতিল, খুন্তি, কড়াই ইত্যাদি), রাসায়নিক পদার্থ (এসিড) বা কারেন্টের তার জ্বলে যাওয়া জায়গায় হাত লেগে ইত্যাদি কারনেই সাধারণত হাত-পা পুড়ে যেতে পারে। এক্ষেত্রে যা করতে হবে- - আগুনে বা গরম পানিতে পুড়ে গেলে দ্রুত আক্রান্ত স্থানটি পরিষ্কার ঠাণ্ডা পানির নিচে ধরুন। - আক্রান্ত স্থানে সিল্কক্রিম লাগালে উপকার পাওয়া যায়। এ ক্ষেত্রে এন্টিবায়োটিক ক্রিম লাগানো যেতে পারে। - পোড়ার পরিমাণ বেশি হলে অবশ্যই চিকিৎসকের পরামর্শ নিতে হবে।  করনীয়ঃ (ক) দাহ বা ঝলসানো রোগীর ক্ষত অংশে এমনভাবে ধুয়ে ফেলুন যাতে পতিত ঠান্ডা পানি ধীরে ধীরে ক্ষতের উপর দিয়ে গড়িয়ে যায়, এভাবে যতক্ষণ ক্ষস্থানের জ্বালা-যন্ত্রণা না কমে এবং ক্ষতস্থানে গরমভাব না কমে ততক্ষণ ঠান্ডা পানি দিতে হবে অথবা ক্ষত অংশকে পানিতে ডুবিয়ে রাখুন। (খ) পরিস্কার জীবানুমুক্ত ব্যান্ডেজ বা কাপড় দিয়ে ক্ষতস্থান হালকা করে বেঁধে দিতে হবে। (গ) আহত ব্যক্তির যদি জ্ঞান হারিয়ে ফেলে তবে তাড়াতাড়ি হাসপাতালে প্রেরনের ব্যবস্থা সহ শ্বাস-প্রস্বাসের ব্যবস্থা করতে হবে। বর্জনীয়ঃ (ক) যে কোন লোশন, মালিশ বা তৈল ড্রেসিং ব্যবহার এ বিরত থাকুন।  (খ) পোড়া অংশে হাত লাগানো যাবে না।'),
(20, 'কানে কিছু প্রবেশ করলে', 'অনেক সময় কানের ছিদ্র পথে ছোট কীট পতঙ্গ অথবা ময়লা প্রবেশ করে তবে কানের ছিদ্র পথে । অলিভয়েল বা নারিকেল তেল দিতে হবে। তবে তেল দেয়ার আগে অবশ্যই নিশ্চিত হবে রোগীর কানের পর্দায় কোন ছিদ্র আছে কিনা।  '),
(21, 'চোখের মধ্যে কোন কিছু ঢুকলে', '(ক) যদি পানির ঝাপটা (কয়েক বার) দিয়ে বাইরের বস্তুটি না সরে যায় তাহলে ডাক্তারের নিকট নিয়ে আসবেন। (খ) কোনক্রমে রোগেীকে চোখ ডলতে দেওয়া যাবে না। (গ) যদি বাহিরের কোন কিছু প্রবেশ করে চোখের গােলকে একধারে আটকে থাকে তবে তা পাতলা ভেজা কাপড় বা রুমাল দিয়ে বের করতে হবে। '),
(22, 'ধোঁয়ায় শ্বাস রোধের চিকিৎসা', 'ধোয়ায় আটকে গেলে প্রথমে আত্মরক্ষার প্রয়োজন, তারপর দুর্ঘটনাস্থল থেকে রোগীকে স্থানান্তর করতে হবে। ভেজা তোয়ালে, রুমাল বা কাপড়ের টুকরা দিয়ে নিজের মুখ ও নাক বেঁধে অথবা ফেসমাস্ক লাগিয়ে উদ্ধারের জন্য অগ্রসর হবে তারপর আহত রোগীকে আলো বাতাসের ব্যবস্থা করতে হবে।'),
(23, 'মাথায় আঘাত পেলে', 'আঘাত যদি মাথায় হয় তাহলে সতর্ক থাকা উচিত। মাথার আঘাত পাওয়া বলতে গেলে আমরা সাধারণত মাথার ভেতরে মস্তিষ্কে আঘাত পাওয়াকে বুঝে থাকি।মাথায় আঘাত কতটা গুরুতর সেটা বুঝতে হলে রোগীকে ভালোভাবে নিরীক্ষণ করতে হবে। - মুখে কিছু খেতে দেয়া যাবে না। - আঘাতের পর বমি, অতিরিক্ত ঘুম ঘুম ভাব, প্রচণ্ড মাথাব্যথা ইত্যাদি উপসর্গ থাকলে হাসপাতাল বা চিকিৎসকের সাহায্য নিতে হবে। - রোগীকে যত দ্রুত সম্ভব উন্নত এমন কোনো হাসপাতালে নিয়ে যেতে হবে যেখানে ব্রেইনের সিটি স্ক্যান বা এমআরআই করার সুযোগ আছে। ');

